Ударний вертоліт — військовий вертоліт, який виконує функції штурмовика, здатний вражати цілі на землі (також їх називають штурмовими вертольотами). На сьогоднішній день такий вертоліт має дві основні ролі: 
* забезпечення прямої і точної авіапідтримки наземних військ; 
* знищення бронетехніки. Ударні вертольоти також використовуються в ролі розвідників. Озброєння ударних вертольотів може включати в себе ПТРК, високоточні ракети, кулемети, малокаліберні гармати. Деякі ударні оснащуються ракетами класу повітря-повітря, але лише для самооборони.

